```python
def is_prime(n: int) -> bool:
    """
    Returns True if 'n' is a prime number, False otherwise.
    """
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True
``HeaderCode generation for determining whether a number is prime! You can use this function to quickly identify prime numbers in your Python applications.

