To draw a chessboard from a FEN notation in LaTeX, you'll need to use a combination of packages and custom graphics. I'll provide you with a solution that uses the `tikz` package and some custom macros.

**Required packages:**
```latex
\documentclass{article}
\usepackage{tikz}
\usetikzlibrary{shapes.geometric}
```
**Custom macros:**
```latex
\newcommand{\squaresize}{0.75cm} % adjust to your liking
\newcommand{\white}{white!30} % light square color
\newcommand{\black}{black!30} % dark square color

\newcommandHeaderCode{}
HeaderCode{
  \tikzset{%
    chess square/.style={draw, thick, rectangle, minimum size=\squaresize, inner sep=0pt},
    light square/.style={fill=\white},
    dark square/.style={fill=\black}
  }
}

HeaderCode
```
**FEN-to-LaTeX-conversion function:**
```latex
\newcommand{\printchessboard}[1]{%
  \begin{tikzpicture}
    \def\rows{} % store the rows of the FEN
    \foreach \row [count=\xi from 1] in #1 {
      \edef\rowstr{}
      \foreach \square [count=\yi from 1] in \row {
        \edef\rowstr{\rowstr%
          \ifnum \yi>1 %
            |
          \fi%
          \ifnum \square=1 % rook
            \draw[dark square];
          \elifnum \square=2 % knight
            \draw[white!] circle[radius=0.3*\squaresize];
          \elifnum \square=3 % bishop
            \draw[dark square] (-\squaresize,-\squaresize) -- (\squaresize,\squaresize);
          \elifnum \square=4 % queen
            \draw[dark square] (-\squaresize,-\squaresize) -- (\squaresize,\squaresize);
            \draw[dark square] (\squaresize,-\squaresize) -- (\squaresize,\squaresize);
          \elifnum \square=5 % king
            \draw[fill=black!"60"] circle[radius=0.35*\squaresize];
          \elifnum \square=6 % pawn
            \ifnum \yi<9
              \draw[white!] ([yshift=-0.4*\squaresize]0,\yi*\squaresize) -- (0.8*\squaresize,\yi*\squaresize);
            \fi
          \fi%
        }
      \node at (\xi*\squaresize,-0.1*\squaresize) {\scriptsize \yi};
      \edef\rows{\rows\nrowstr\\\uncr};
      }
    \foreach \x in {1,...,8} {
      \node at (\x*\squaresize,-\squaresize*9-\squaresize/2) {\scriptsize \x};
    }
    \rows
  \end{tikzpicture}
}

% Example usage:
\begin{document}
\HeaderCode
\rule{\textwidth}{0.4pt} % optional board border
\printchessboard{rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR}

\end{document}
```
**Explanation:**

1. The `HeaderCode` defines the styles and settings for the chessboard squares.
2. The `\printchessboard` macro takes a FEN string as an argument, parses it, and draws the board.
3. It uses a combination of `foreach` loops to iterate over the rows and squares of the FEN.
4. For each square, it checks the FEN code and draws the corresponding piece (or leaves it blank).
5. The board is then drawn with the specified square sizes and light/dark square colors.

**Note:** This implementation is basic and might not cover all FEN notation nuances. You may need to modify the macros to accommodate specific FEN variations.

