Here is a Java solution without loops/recursion:

```java
class Solution {
    public boolean isPowerOfThree(int n) {
        if (n < 1) return false;
        int max = 144; // 3^4 = 81, 3^5 = 243, 3^6 = 729, so we can stop at 3^6
        while (max > 0) {
            if (n == max) return true;
            max /= 3;
        }
        return false;
    }
}
```

This solution works by repeatedly dividing `n` by 3 until `n` is less than 1. If `n` becomes 1 at any point, it's a power of three and we return `true`. If we finish the loop without `n` becoming 1, it's not a power of three and we return `false`.

Alternatively, you can use Math.log to solve this problem in a single line:

```java
class Solution {
