Here's an implementation of a queue data structure using two stacks in Python:

```Python
class Queue:
    def __init__(self):
        # Initialize two stacks to implement the queue
        self.stack_newest_entry_first = []
        self.stack_oldest_entry_first = []

    def enqueue(self, value):
        # Add new entries to the newest_entry_first stack
        self.stack_newest_entry_first.append(value)

    def dequeue(self):
        if not self.stack_oldest_entry_first:
            # If oldest_entry_first stack is empty, move all elements from newest_entry_first to oldest_entry_first
            while self.stack_newest_entry_first:
                self.stack_oldest_entry_first.append(self.stack_newest_entry_first.pop())
        return self.stack_oldest_entry_first.pop()

    def is_empty(self):
        return not (self.stack_newest_entry_first or self.stack_oldest_entry_first)

    def size(self):
        return len(self.stack_newest_entry_first) + len(self.stack_oldest_entry_first)


# Example usage:
queue = Queue()
queue.enqueue('A')
queue.enqueue('B')
queue.enqueue('C')

print(queue.dequeue())  # Outputs: A
print(queue.dequeue())  # Outputs: B
queue.enqueue('D')
print(queue.dequeue())  # Outputs: C
print(queue.dequeue())  # Outputs: D
print(queue.is_empty())  # Outputs: True
```

This implementation works by always adding new elements to the `newest_entry_first` stack. When the `dequeue` operation is performed, if the `oldest_entry_first` stack is empty, we move all elements from `newest_entry_first` to `oldest_entry_first`, effectively reversing the order of elements. Then, we can simply remove the oldest element from `oldest_entry_first`. This way, the order of elements is maintained as FIFO (First-In-First-Out), characteristic of a queue.

Here is a simple and efficient solution in C to find common elements in two arrays without using any extra data structures:

```c
#include <stdio.h>

void findCommon(int arr1[], int arr2[], int m, int n) {
    if (m > n) {
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (arr1[i] == arr2[j]) {
                    printf("%d ", arr1[i]);
                    break;
                }
            }
        }
    } else {
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                if (arr1[j] == arr2[i]) {
                    printf("%d ", arr1[j]);
                    break;
                }
            }
        }
    }
}

int main() {
    int arr1[] = {1, 2, 3, 4, 5};
    int arr2[] = {4, 5, 2, 6, 7};
    int m = sizeof(arr1) / sizeof(arr1[0]);
    int n = sizeof(arr2) / sizeof(arr2[0]);

    printf("Common elements: ");
    findCommon(arr1, arr2, m, n);
    return 0;
}
```

This program iterates through both arrays and checks for equality at each position. If a match is found, it prints the common element and breaks the inner loop to move on to the next element in the outer array.

Note: The time complexity of this solution is O(m*n), which is not efficient for large inputs. For a more efficient solution with a time complexity of O(n log n), you can sort the arrays and then use two pointers to find common elements. Here's an example implementation:

```c
#include <stdio.h>
#include <stdlib.h>

void sortArray(int arr[], int n) {
    for (int i = 0; i < n; i++) {
        for (int j = i + 1; j > 0; j--) {
            if (arr[j - 1] > arr[j]) {
                int temp = arr[j - 1];
                arr[j - 1] = arr[j];
                arr[j] = temp;
            } else {
                break;
            }
        }
    }
}

void findCommon(int arr1[], int arr2[], int m, int n) {
    int i = 0, j = 0;
    while (i < m && j < n) {
        if (arr1[i] == arr2[j]) {
            printf("%d ", arr1[i]);
            i++;
            j++;
        } else if (arr1[i] < arr2[j]) {
            i++;
        } else {
            j++;
        }
    }
}

int main() {
    int arr1[] = {1, 2, 3, 4, 5};
    int arr2[] = {4, 5, 2, 6, 7};
    int m = sizeof(arr1) / sizeof(arr1[0]);
    int n = sizeof(arr2) / sizeof(arr2[0]);

    printf("Original arrays:\n");
    printf("Arr1: ");
    for (int i = 0; i < m; i++) {
        printf("%d ", arr1[i]);
    }
    printf("\n");
    printf("Arr2: ");
    for (int i = 0; i < n; i++) {
        printf("%d ", arr2[i]);
    }
    printf("\n");

    sortArray(arr1, m);
    sortArray(arr2, n);

    printf("Sorted arrays:\n");
    printf("Arr1: ");
    for (int i = 0; i < m; i++) {
        printf("%d ", arr1[i]);
    }
    printf("\n");
    printf("Arr2: ");
    for (int i = 0; i < n; i++) {
        printf("%d ", arr2[i]);
    }
    printf("\n");

    printf("Common elements: ");
    findCommon(arr1, arr2, m, n);
    return 0;
}
```

This implementation sorts both arrays and then uses two pointers to find common elements. The time complexity is O(n log n) due to the sorting operation.
